import React,{Component} from 'react';
import {View,Text,StyleSheet,ImageBackground, Alert}from 'react-native';
import { Icon,Card,Button} from 'react-native-elements';
import *as firebase from 'firebase';
import { FlatList } from 'react-native-gesture-handler';
export default class vehicle extends Component{
    constructor(props)
    {
        super(props);
       this.state={
           num:[]
       }
    }
    componentDidMount(){
         const id=this.props.navigation.navigate('id','');
         firebase.database().ref(`/Users/`).on('value',snap=>{
           snap.forEach(data=>{
               data.forEach(dataa=>{
                   dataa.forEach(num=>{
                    num.forEach(da=>{
                    if(da.key==='VehicleRegistration')
                    {
                        var min = 1;
                        var max = 100;
                     var rand = (min + (Math.random() * (max-min))).toString();
                        let register={
                            id:rand,
                            registerNum:da.val()
                        }
                        this.setState({num:register})
                            console.log(this.state.num.registerNum);
                    }
                    })
                   })
               })
           })

         })

    }
    static navigationOptions={
        title:'Your Vehicle'
    }
    render(){
       const renderDe=({item})=>{
           return(
               <View>
                   <Text><Text style={{color:'white'}}>{item.registerNum}</Text></Text>
               </View>
           )
       }
        return(
            <ImageBackground source={require('../../assets/road.jpg')} style={styles.image}>
                <View style={styles.container}>
                 <Text style={{color:'white'}}>{this.state.num.registerNum}</Text>
            <FlatList
            data={this.state.num}
            renderItem={renderDe}
            keyExtractor={(item)=>{item.id.toString()}}/>
             </View>
                </ImageBackground>
        )}
}
const styles=StyleSheet.create({
    image:{
        flex:1,
        resizeMode:'cover',
        justifyContent:'center',
        alignItems:'center'
    },
    container:{
        flex:1,
        justifyContent:'center'
    }
})
